      "learnable": false,
      "source": "data"
    }
  }
}
</VARIABLES>

<SUMMARY>
A linear utility model for responders that calculates utility by weighting the proposed monetary share (split_self) and subtracting a penalty proportional to a fairness benchmark (F), where F is computed from the participant’s contribution relative to the opponent’s in generating the combined earnings. The two learnable parameters, beta and gamma, capture sensitivity to monetary reward and fairness, respectively.
</SUMMARY>
